import frontend from "../../shared/dom.js";
import router from "../../router.js";
import websocketManager from "../../websocket/WebsocketManager.js";
import api from "../../shared/api/api.js";
import {
  retrieveNotifs,
  //initializeNotifHandler,
} from "../../shared/util/notifTool.js";

// =============================================================================
// Login Component
// =============================================================================

function loginComponent(): HTMLElement {
  const container = frontend.create(`
    <div class="flex min-h-full flex-col bg-transparent justify-center px-6 py-12 lg:px-8">
        <div class="sm:mx-auto sm:w-full sm:max-w-sm">
        <div class="mx-auto mb-20 h-16 w-auto text-primary">
            <!-- SVG logo -->
            <div class="flex justify-center">
                <svg 
 xmlns="http://www.w3.org/2000/svg"
 xmlns:xlink="http://www.w3.org/1999/xlink"
 width="100px" height="100px">
<image  x="50%" y="50%" width="90" height="90" transform="translate(-45,-45)" xlink:href="data:img/png;base64," />
</svg>
            </div>
        </div>        
        <h2 class="mt-10 text-center text-[1.3rem] font-headline  font-bold  text-bold  text-primary">Login to your account</h2>
    </div>

    <div class="mt-10 sm:mx-auto sm:w-full sm:max-w-sm">
        <form class="space-y-6" data-component="login">
        <div>
            <label for="username" class="block font-bold text-sm/6 font-headline text-primary">Username</label>
            <div class="mt-2">
            <input 
                type="text" 
                name="username" 
                id="username" 
                autocomplete="username" 
                required 
                class="block w-full rounded-md bg-lightText px-3 py-3 font-headline text-background outline-1 -outline-offset-1 outline-gray-300 placeholder:text-headline font-bold focus:outline-2 focus:-outline-offset-2 focus:outline-secondary sm:text-sm/6"
            >
            </div>
        </div>

        <div>
            <label for="password" class="block font-bold text-sm/6 font-headline text-primary">Password</label>
            <div class="mt-2">
            <input 
                type="password" 
                name="password" 
                id="password" 
                autocomplete="new-password" 
                required 
                class="block w-full rounded-md bg-lightText px-3 py-3 text-background outline-1 -outline-offset-1 outline-gray-300 placeholder:text-background  placeholder:font-headline focus:outline-2 focus:-outline-offset-2 focus:outline-secondary sm:text-sm/6"
            >
            </div> 
        </div>

        <div>
            <button 
            type="submit" 
            class="animationBtn border-8 border-secondary flex w-full justify-center rounded-full bg-transparent font-headline px-3 py-3 font-bold text-sm/6 text-lightText focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-blue-600"
          >
            <span class="fill-bg"></span>
            <span class="button-content">LOGIN</span>
          </button>

        </div>
        <span class="fill-bg"></span>
        </form>
        <p class="mt-10 text-center text-sm/6 font-bold text-lightText font-headline">
            Don't have an account yet?
            <a href="/register" class="font-semibold underline text-accentColour hover:text-secondary">Register here</a>
        </p>
        </div>
    </div>

    `) as HTMLElement;

  // =============================================================================
  // Query Selectors:
  // =============================================================================

  const form = container.querySelector("form") as HTMLFormElement;

  // =============================================================================
  // Event Listeners:
  // =============================================================================


  container.querySelectorAll('.animationBtn').forEach(btn => {
    btn.addEventListener('click', () => {
      btn.classList.add('clicked');
    });
  });



  form.addEventListener("submit", async (event) => {
    event.preventDefault();

    const formData = new FormData(form);
    const username = (formData.get("username") as string).trim();
    const password = formData.get("password") as string;

    try {
      const data = await api.login(username, password);
      // set current user state
      await api.getCurrentUser();

      console.log("window.app.state.user: ", window.app.state.user);
      // connect to websocket
      if (window.app.state.user) {
        websocketManager.connect();
      }

      //retrieve pending notifications from backend and listen for new notifications
        // await retrieveNotifs();

      alert(data.message || "Login successful! Enjoy!");
      await router.go("/");
    } catch (error) {
      const errorMessage = (error as Error).message;
      console.log("errorMessage", errorMessage);
      if (errorMessage === "Invalid username or password") {
        alert("Invalid username or password. Please try again.");
      } else if (errorMessage.includes("already in use")) {
        alert("This account is already in use on another device or tab.");
      } else {
        alert("An unexpected error occurred. Please try again later.");
      }
    }
  });

  return container;
}

export default loginComponent;
